import React from 'react';
import './App.css';
import OrgCard from './components/OrgCard/OrgCard';

function App() {

  tools = ["c++", "python"]

  return (
    <div className="App">
      <header className="App-header">

        <OrgCard applicants="2" tools={tools}/>


      </header>
    </div>
  );
}

export default App;
